import './App.css';
import React from "react";
import { BrowserRouter as Router, Route, Routes } from "react-router-dom";
import Home from './Components/Home';
function App() {
  return (
    <div className='App'>
      <Router>
          <div>
            <Routes>

              <Route path="/" element={<Home/>}></Route>
              <Route path="*" element={<div>404 NOT FOUND</div>}></Route>
            </Routes>

          </div>
        </Router>
      <Home/>
    </div>
  );
}

export default App;
